import React from 'react'
import './Listitems.css'

    function Listitems(props){
    const items=props.items;
    const listItems=items.map(item=>
    {
        return<div className="list" key={item.key}>

           <p className='chk'>
           onClick={()=>props.completeitem(item.key)} className={`fa fa-check-circle pointer ${item["done"]?"green":"blue"}`}
             <i title='complete'  />
              <input id="myCheckBox" type="checkbox" class="checkbox" />

              <div className={item.checkvalue?"line-through": null}>{item.text}</div> 
              {/* {item.text} */}
             <i title='delete' onClick={()=>props.deleteItem(item.key)} className="fa fa-trash" />

            </p>

          </div>

 })


return(


    <div>
        {items && items.length>0?
            listItems:<p id="emptytask" style={{textAlign:"center",fontsize:"24px"}}>
                Seems like a quiet day
            </p>    
    }

    </div>

)}
export default Listitems;
